textOriginal:
@pkkkks Disculpa entonces, tenemos más desigualdad hoy ante la ley, tenemos a.los.militsres viviendo como comunistas, y gente dividos por casta por su nivel de ingresos, más policías per capita en comunas pudientes que en comunas de alto nivel delictivo, que son generalmente más pobres, es decir, los más dañados por.la delincuencia hoy no son los que tienen cámaras y filman un portonazo, son los que cogotean  y le roban el dinero del mes o la semana, o mueren por defender lo poco que tienen, eso es desigualdad real.
Otra, Reconocoer a los pueblos originarios cómo parte de.la nación como una nación y reconocerles sus tradiciones y costumbres , NO es ponerlos sobre la.ley nuestra, eso no dice la Constitución y estás mal informado al respecto. Si te señalo ese juicio disculpa, pero es porque ese tipo de comentarios, proviene de creer una supuesta superioridad indígena, entre el resto de los chilenos, que no existe en la Nueva Constitución y huele a racismo, - "Cómo un indio va a tener mejores condiciones que nosotros," cuando NO es así, hasta hoy existe preferencias en consultorios y escuelas, becas y acceso preferente a vivienda p.e. porque esos pueblos fueron tratados con desprecio y el mismo estado Unitario,  por más de 200 años,y en base a una ideología de superioridad racial  pretendió acabar y extienguirlo. Sin lograrlo, porque tuvieron la fuerza y la convicción, que como cultura y visión tienen valor para la humanidad, especialmente en su relación con la naturaleza, de ellos tenenos mucho que aprender.
Otra, el Chaqueteo, porque dicen que está constitucion no los representanta? Si la.hicieron ciudadanos igual que tú y y hay que Mirarla con lupa,  y todo lo que tenga malo va a ser nefasto para el país, lo que tampoco es cierto, es un rayado de cancha para cambiar el actual modelo de subsidariedad a uno de derechos  y está hecho por gente igual que nosotros , que pensó por nosotros y la gran mayoría volverá a ser su trabajo de siempre, igual que nosotros. porque tendría yo que mirarla con desprecio o sospecha? Si se utilizó el mismo sistema de elección de los diputados, sistema que nadie antes lo ha considerado antidemocrático y no representativo,  Hoy los que hicieron la Constitución sons ciudadanos igual que tú y como Yo, que políticos y eso es lo que le molesta a los políticos de todos los sectores, porque los que están. perdiendo poder son ellos, y cuando pierden poder, pierden el dinero que les pagan los grandes empresarios y corporaciones para hacer las leyes. Disculpa nuevamente.
